import React from 'react';
import Card from '../components/card';
import '../style/home.css';
import makeupImage from '../assets/makeup.jpeg'; // Adjust the path as necessary

const Home = () => {
    const handleBookNow = () => {
        alert('Booking initiated!');
    };

    return (
        <Card 
            image={makeupImage} 
            name="Nicky" 
            profession="Makeup Artist" 
            location="Phillip" 
            onBook={handleBookNow} 
        />
    );
};

export default Home;
